function CreateDeck() {
  return (
    <Fragment>
      <nav class="navbar navbar-light bg-light">
        <div class="container-fluid">
          <a class="navbar-brand" href="#">
            Home / Create Deck
          </a>
        </div>
      </nav>
			<h1></h1>
    </Fragment>
  );
}

export default CreateDeck;
